    TResult Function(ServerErrorException value)? serverErrorException,
    TResult Function(ForbiddenRequestException value)?
        forbiddenRequestException,
    TResult Function(UncaughtResponseCodeException value)?
        uncaughtResponseCodeException,
    TResult Function(ClientException value)? clientException,
    required TResult orElse(),
  }) {
    if (clientException != null) {
      return clientException(this);
    }
    return orElse();
  }
}

abstract class ClientException implements AppException {
  factory ClientException(final String message) = _$ClientException;

  @override
  String get message;
  @override
  @JsonKey(ignore: true)
  _$$ClientExceptionCopyWith<_$ClientException> get copyWith =>
      throw _privateConstructorUsedError;
}
